import React, { useCallback } from 'react';
import Head from 'next/head';
import Layout from '../components/Layout';
import { Form, Input } from 'antd';

const SignUp = () => {
  const onSubmit = useCallback(() => {
    console.log('onSubmit')
  }, [])

  const onChangeValue = useCallback((e) => {
    console.log('onChangeValue')
  }, [])

  return (
    <>
      <Head>
        <title>Sign Up | Earth-Bird</title>
      </Head>
      <Layout>
        <Form onFinish={onSubmit}>
          <div>
            <Input
              type="text"
              name="id"
              value={id}
              placeholder="아이디"
              onChange={(e) => onChangeValue(e)}
              required
            />
          </div>
          <div>
            <Input
              type="text"
              name="nickname"
              value={nickname}
              placeholder="닉네임"
              onChange={(e) => onChangeValue(e)}
              required
            />
          </div>
          <div>
            <Input
              type="password"
              name="password"
              value={password}
              placeholder="비밀번호"
              onChange={(e) => onChangeValue(e)}
              required
            />
          </div>
          <div>
            <Input
              type="password"
              name="checkPassword"
              value={checkPassword}
              placeholder="비밀번호 확인"
              onChange={(e) => onChangeValue(e)}
              required
            />
          </div>
        </Form>
      </Layout>
    </>
  )
}

export default SignUp;
